import React from 'react'
import './MobileMenu.css'
import { GiHamburgerMenu } from 'react-icons/Gi';


function MobileMenu() {
    return (
        <div className='mobileMenu'>
            <GiHamburgerMenu className='mobileMenu_icon' />
        </div>
    )
}

export default MobileMenu
